{
	"openapi": "3.0.1",
	"servers": [
		{
			"description": "API para a entidade Ambientes de Trabalho (WorkEnvironments) para produtos TOTVS",
			"url": "{{host}}/api/rh/v1",
			"variables": {
				"serverUrl": {
					"default": "localhost"
				},
				"serverHttpPort": {
					"default": "8051"
				}
			}
		}
	],
	"info": {
		"description": "API para a entidade Ambientes de Trabalho (WorkEnvironments) para produtos TOTVS",
		"version": "1.000",
		"title": "Ambiente de Trabalho",
		"contact": {
			"name": "T-Talk",
			"url": "API.Totvs.com.br",
			"email": "comiteintegracao@totvs.com.br"
		},
		"x-totvs": {
			"messageDocumentation": {
				"name": "WorkEnvironments",
				"description": "Ambientes de Trabalho",
				"segment": "Recursos Humanos"
			},
			"productInformation": [
				{
					"product": "RM",
					"contact": "rm_FW@totvs.com.br",
					"description": "Listagem dos Ambientes de Trabalho"
				}
			]
		}
	},
	"paths": {
		"/workenvironments": {
			"get": {
				"tags": [
					"WorkEnvironments"
				],
				"summary": "Retorna todos os Ambientes de Trabalho",
				"x-totvs": {
					"productInformation": [
						{
							"product": "RM",
							"available": true,
							"note": "Este verbo esta disponível com todos os parâmetros",
							"minimalVersion": "12.1.23"
						}
					]
				},
				"description": "Retorna todos os Ambientes de Trabalho",
				"operationId": "getWorkEnvironments",
				"parameters": [
					{
						"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/apis/types/totvsApiTypesBase.json#/parameters/Authorization"
					},
					{
						"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/apis/types/totvsApiTypesBase.json#/parameters/Order"
					},
					{
						"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/apis/types/totvsApiTypesBase.json#/parameters/Page"
					},
					{
						"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/apis/types/totvsApiTypesBase.json#/parameters/PageSize"
					},
					{
						"$ref": "#/components/parameters/WorkEnvironmentIds"
					}
				],
				"responses": {
					"200": {
						"description": "Operação realizada com sucesso",
						"content": {
							"application/json": {
								"schema": {
									"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/schemas/WorkEnvironments_1_000.json#/definitions/WorkEnvironmentsInfo"
								}
							}
						}
					},
					"400": {
						"description": "Erro no momento da listagem dos Ambientes de Trabalho",
						"content": {
							"application/json": {
								"schema": {
									"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/apis/types/totvsApiTypesBase.json#/definitions/ErrorModel"
								}
							}
						}
					}
				}
			},
			"post": {
				"tags": [
					"WorkEnvironments"
				],
				"summary": "Inclui um novo registro na tabela de Ambientes de Trabalho",
				"x-totvs": {
					"productInformation": [
						{
							"product": "RM",
							"available": true,
							"note": "Este verbo esta disponivel com todos parametros",
							"minimalVersion": "12.1.23"
						}
					]
				},
				"parameters": [
					{
						"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/apis/types/totvsApiTypesBase.json#/parameters/Authorization"
					}
				],
				"description": "Inclui um novo registro na tabela de Ambientes de Trabalho",
				"operationId": "postWorkEnvironments",
				"requestBody": {
					"description": "Objeto para atualizar o registro de Ambientes de Trabalho",
					"content": {
						"application/json": {
							"schema": {
								"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/schemas/WorkEnvironments_1_000.json#/definitions/WorkEnvironmentsInfo"
							}
						}
					}
				},
				"responses": {
					"200": {
						"description": "Operação executada com sucesso",
						"content": {
							"application/json": {
								"schema": {
									"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/schemas/WorkEnvironments_1_000.json#/definitions/WorkEnvironmentsInfo"
								}
							}
						}
					},
					"400": {
						"description": "Erro na execução da operação",
						"content": {
							"application/json": {
								"schema": {
									"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/apis/types/totvsApiTypesBase.json#/definitions/ErrorModel"
								}
							}
						}
					}
				}
			}
		},
		"/workenvironments/{id}": {
			"get": {
				"tags": [
					"WorkEnvironments"
				],
				"summary": "Retorna dados de tabela do Ambiente de Trabalho especificado",
				"x-totvs": {
					"productInformation": [
						{
							"product": "RM",
							"available": true,
							"note": "Este verbo esta disponivel com todos parametros",
							"minimalVersion": "12.1.23"
						}
					]
				},
				"description": "Retorna dados de tabela do Ambiente de Trabalho especificado",
				"operationId": "getWorkEnvironmentId",
				"parameters": [
					{
						"$ref": "#/components/parameters/WorkEnvironmentId"
					},
					{
						"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/apis/types/totvsApiTypesBase.json#/parameters/Authorization"
					}
				],
				"responses": {
					"200": {
						"description": "Operação executada com sucesso",
						"content": {
							"application/json": {
								"schema": {
									"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/schemas/WorkEnvironments_1_000.json#/definitions/WorkEnvironmentsInfo"
								}
							}
						}
					},
					"400": {
						"description": "Erro na execução da operação",
						"content": {
							"application/json": {
								"schema": {
									"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/apis/types/totvsApiTypesBase.json#/definitions/ErrorModel"
								}
							}
						}
					}
				}
			},
			"delete": {
				"tags": [
					"WorkEnvironments"
				],
				"summary": "Exclui um Ambiente de Trabalho",
				"x-totvs": {
					"productInformation": [
						{
							"product": "RM",
							"available": true,
							"note": "Este verbo esta disponivel com todos parametros",
							"minimalVersion": "12.1.23"
						}
					]
				},
				"description": "Exclui Ambiente de Trabalho",
				"operationId": "DeleteWorkEnvironmentId",
				"parameters": [
					{
						"$ref": "#/components/parameters/WorkEnvironmentId"
