				"responses": {
					"200": {
						"description": "Operação executada com sucesso"
					},
					"400": {
						"description": "Erro na execução da operação",
						"content": {
							"application/json": {
								"schema": {
									"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/apis/types/totvsApiTypesBase.json#/definitions/ErrorModel"
								}
							}
						}
					}
				}
			},
			"put": {
				"tags": [
					"WorkEnvironments"
				],
				"summary": "Atualiza um registro existente de tabela de Ambientes de Trabalho",
				"x-totvs": {
					"productInformation": [
						{
							"product": "RM",
							"available": true,
							"note": "Este verbo esta disponivel com todos parametros",
							"minimalVersion": "12.1.23"
						}
					]
				},
				"description": "Atualiza um registro existente de tabela de Ambientes de Trabalho. Caso não seja informado alguma propriedade para ser atualizada, está será considerada nula.",
				"operationId": "putWorkEnvironmentId",
				"parameters": [
					{
						"$ref": "#/components/parameters/WorkEnvironmentId"
					},
					{
						"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/apis/types/totvsApiTypesBase.json#/parameters/Authorization"
					}
				],
				"requestBody": {
					"description": "Objeto para atualizar o registro de tabela de Ambientes de Trabalho",
					"content": {
						"application/json": {
							"schema": {
								"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/schemas/WorkEnvironments_1_000.json#/definitions/WorkEnvironmentsInfo"
							}
						}
					}
				},
				"responses": {
					"200": {
						"description": "Ambiente de Trabalho atualizado com sucesso",
						"content": {
							"application/json": {
								"schema": {
									"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/schemas/WorkEnvironments_1_000.json#/definitions/WorkEnvironmentsInfo"
								}
							}
						}
					},
					"400": {
						"description": "Erro na execução da operação",
						"content": {
							"application/json": {
								"schema": {
									"$ref": "https://raw.githubusercontent.com/totvs/ttalk-standard-message/master/jsonschema/apis/types/totvsApiTypesBase.json#/definitions/ErrorModel"
								}
							}
						}
					}
				}
			}
		}
