	"components": {
		"parameters": {
			"WorkEnvironmentId": {
				"name": "id",
				"in": "path",
				"required": true,
				"description": "Identificador Único representando o Ambiente de Trabalho",
				"schema": {
					"type": "string"
				}
			},
			"WorkEnvironmentIds": {
				"name": "workEnvironmentIds",
				"in": "query",
				"description": "Códigos dos Ambientes de Trabalho retornados pelo get separado por vírgula (,) ",
				"required": false,
				"example": "param1,param2",
				"schema": {
					"type": "string"
				}
			}
		},
		"schemas": {}
	}
}
